class ImageFill{static fill(grabfrom){null!=grabfrom&&null!=grabfrom&&0!==grabfrom.length&&fetch(grabfrom).then((function(response){200===response.status&&response.json().then((function(data){document.querySelectorAll("img[data-imagefill").forEach(img=>{let temp=data[img.dataset.imagefill];null!=temp&&null!=temp&&0!==temp.length&&(img.src=temp)})}))}))}}